let opener;function insertMultiImages(e){let t="";e.forEach((function(e){t+=`<p><img src="${e.url}" alt="${e.name}"></p>`})),tinymce.activeEditor.insertContent(t),opener.close()}tinymce.PluginManager.add("multiimage",(function(e,t){e.ui.registry.addButton("multiimage",{icon:"multi-image",tooltip:"Insert Multi-Images",onAction:function(){opener=e.windowManager.openUrl({title:"Select Images",url:"/laravel-filemanager?type=image&multiple=true&callback=insertMultiImages"})}})}));
